script: |
  super -f text -I q7696.spq | sort > q7696.out

inputs:
  - name: q7696.spq
    data: |
      SELECT DISTINCT - 16 + ( + cor0.col1 * ( + cor0.col0 ) ) + + col1 / - ( - col1 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q7696.out
    data: |
      1328
      202
      4587
